import React from "react";
import styles from './main.module.css';

export const  Main = () => {
    return(
        <div className={styles.container}>
            <div className={styles.main}>
                <img src="./images/1354860_20201112142649_570_0001.jpg">
                    <p>안녕하세요</p>
                </img>
            </div>
        </div>
    );
}
